import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="App-logo">
          <img src="./images/mylogo.jpg" alt="logo" />
        </div>
        <div class="App-top-menu">
          top menu
        </div>
      </header>
      <div class="App-content">
          Masha Website
        </div>
    </div>
  );
}

export default App;
